const Skills = () => {
  return (
    <div className="container flex flex-col mt-10 mx-auto">
      {/* <div className="flex justify-center mt-5"> */}
      <div className="flex justify-start items-center  text-orange-600 font-bold text-lg">
        Skills
      </div>
      <div className="flex justify-start mt-5">
        <div className="grid grid-cols-4 gap-x-56 gap-y-3 place-content-stretch h-44 font-light ">
          <div className="transition duration-300 hover:scale-125 ">HTML</div>
          <div className="basic 1/4">CSS</div>
          <div className="basic 1/4">Javascript</div>
          <div className="basic 1/4">Jquery</div>
          <div className="basic 1/4">Bootstrap</div>
          <div className="basic 1/4">Tailwindcss</div>
          <div className="basic 1/4">React</div>
          <div className="basic 1/4">Java</div>
          <div className="basic 1/4">Python</div>
          <div className="basic 1/4">VBA</div>
          <div className="basic 1/4">MySQL</div>
          <div className="basic 1/4">PostgreSQL</div>
        </div>
      </div>
      {/* </div> */}
    </div>
  );
};

export default Skills;
